tables.table_schema:
CREATE TABLE Patients (
 patient_id INT PRIMARY KEY,
 patient_name VARCHAR(50),
 medication_id INT,
 adherence_level INT
);

CREATE TABLE Medications (
 medication_id INT PRIMARY KEY,
 medication_name VARCHAR(50),
 dosage VARCHAR(20)
);

CREATE TABLE AdherenceRecords (
 record_id INT PRIMARY KEY,
 patient_id INT,
 date DATE,
 adherence_level INT
);

CREATE TABLE Medications (
    medication_id INT PRIMARY KEY,
    medication_name VARCHAR(50),
    dosage FLOAT,
    side_effects VARCHAR(500)
);

CREATE TABLE medications (
    med_id INT PRIMARY KEY,
    med_name VARCHAR(50),
    dosage VARCHAR(20),
    instructions TEXT
);

CREATE TABLE adherence_logs (
    log_id INT PRIMARY KEY,
    prescription_id INT,
    adherence_status VARCHAR(20),
    logged_date DATE
);

CREATE TABLE compliance_predictions (
    prediction_id INT PRIMARY KEY,
    patient_id INT,
    compliance_probability FLOAT,
    predicted_date DATE
);
